@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ValidCashCard a owl:Class .
atm:ValidPassword a owl:Class .
atm:ProblemWithAccount a owl:Class .
atm:Bank a owl:Class .
atm:ATM a owl:Class .
atm:Message a owl:Class .

atm:hasValidCashCard a owl:ObjectProperty ;
    rdfs:domain atm:Bank ;
    rdfs:range atm:ValidCashCard .

atm:hasValidPassword a owl:ObjectProperty ;
    rdfs:domain atm:Bank ;
    rdfs:range atm:ValidPassword .

atm:hasProblemWithAccount a owl:ObjectProperty ;
    rdfs:domain atm:Bank ;
    rdfs:range atm:ProblemWithAccount .

atm:sendsMessage a owl:ObjectProperty ;
    rdfs:domain atm:Bank ;
    rdfs:range atm:ATM .

atm:hasMessage a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Message .

atm:Message rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:hasMessage ;
    owl:someValuesFrom [
        a owl:Class ;
        owl:intersectionOf (
            atm:ValidCashCard
            atm:ValidPassword
            atm:ProblemWithAccount
        )
    ]
] .
